import React from 'react'
import styles from './Nav.module.css'
import {NavLink} from 'react-router-dom'
interface INavItems {
    text:string
    ref:string
}
const Nav = () => {
    const navItems:Array<INavItems> = [{text:'Plan',ref:'/plan',id:v1},{text:'Table',ref:'/table'}]
    return(
    <div className={styles.nav}>
        <img src="logo192.png" alt="logo" className={styles.img}/>
        <nav>
            <ul className={styles.ul}>
                {navItems.map((item) => <li><NavLink to={item.id} key={item.text}>{item.text}</NavLink></li>)}
            </ul>
        </nav>
        
    </div>
    )
}

export default Nav
